import React from 'react';
import classes from './Consultatii.module.css'; // Adjust the path if needed

const consultations = [
    {
        doctor: 'Dr. Smith',
        date: '2024-01-15',
        diagnosticPdf: '/path/to/diagnostic.pdf',
        prescriptionPdf: '/path/to/prescription.pdf',
    },
    // Add more consultation data as needed
];

const Consultatii = () => {
    return (
        <div className={classes.consultatiiContainer}>
            <h2 className={classes.consultatiiTitle}>Consultatii</h2>

            <ul className={classes.consultationList}>
                {consultations.map((consultation, index) => (
                    <li key={index} className={classes.consultationItem}>
                        <div className={classes.consultationDetails}>
                            <div>
                                <strong>Doctor:</strong> {consultation.doctor}
                            </div>
                            <div>
                                <strong>Date:</strong> {consultation.date}
                            </div>
                        </div>
                        <div className={classes.consultationFiles}>
                            <a href={consultation.diagnosticPdf} target="_blank" rel="noopener noreferrer">
                                Diagnostic PDF
                            </a>
                            <a href={consultation.prescriptionPdf} target="_blank" rel="noopener noreferrer">
                                Prescription PDF
                            </a>
                        </div>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Consultatii;
